  return (
    <ul>
      <FriendItem initialFriends />
    </ul>
  );
}

function FriendItem(initialFriends) {
  return (
    <ul>
      {initialFriends.map((f) => (
        <li>{f.name}</li>
      ))}
    </ul>
  );
}
